import React from 'react';
import Navbar from './Navbar'

function Header() {
    return(
        <div id='main'>
            <Navbar/>
           <div classname='name'>
               <h1>Mid-Tier Web <span>developer</span></h1>
           </div>

        </div>
    )
}

export default Header;
